import React from 'react'
import './styles.css';

const Home = () => {
    return (
        <div className='home-container'>
            <div className='image-gallery'>
                <div className='image-box'>
                    <img src={'./img/dolly-1.jpg'} alt='sweater-dolly' />
                </div>
            </div>
        </div>
    )
}

export default Home
